INSERT INTO `song_list` VALUES (18,'awit sa gugma',60,'VERSE:\r\nSa tinuod lang\r\nGibati ako sa paghigugma Nimo\r\nTungod sa gipakita\r\nNga gugma kanako\r\nIngon sa dili ako\r\nMahimutang kung malayo kanimo\r\nBusa dili ug dili ako\r\nMubiya Kanimo oh Ginoo\r\n\r\nCHORUS:\r\nBisan wala kita makita\r\nApan nakita ko ang gugma Mo\r\nBuhi ka nga Dios nga among gialagaran\r\nBisan ako makasasala\r\nImo akong gipakaway sala\r\nTakus ka sa tanang pagdayeg ug pasalamat\r\n\r\nBRIDGE:\r\nSalamat, sa grasya ug kalooy mo kanako\r\nOh Ginoo\r\nSalamat, gugma Mong walay paglubad\r\nNga giluwas Mo ako sa pagkamakasasala oh Ginoo','https://youtu.be/ERrOtkRP9HU'),(19,'Awiton ko',60,'Verse 1\r\nAko nagapangita Mo\r\nSa katagbawan sa presensya Mo\r\nIkaw ang gipangandoy ko\r\nSa kinatibuk-an sa kasing-kasing ko\r\n\r\nCHORUS:\r\nAwiton ko ang gamhanang ngalan Mo\r\nMagasimba ako diha sa truno Mo\r\nDaygon ko ang buhing ngalan Mo\r\nSa Espirito Santo ug kamatuoran.\r\n\r\n(Repeat Verse & Chorus 2x)\r\n',NULL),(20,'DILI MAKAWANG',60,'Nagasalig,nagatuo sa imong mga pulong\r\nMga saad nga Imong pagatumanon\r\nNag hangyo nagapangayo sa among gikinahanglan\r\nMga tinguha sulod ning dughan ko\r\nNag-ampo, nagadayeg sa Imong buhing ngalan\r\nNagapangita sa gingharian Mo\r\n\r\nDili makawang ang tanan\r\nAng among pagpangamuyo\r\nUban sa presensya\r\nIkaw gayud nagatubag oh Diyos\r\n\r\nDili makawang ang tanan\r\nAng among pagpangabudlay\r\nIkaw sa kanunay nagahatag\r\nKalig-on ug kusog\r\n\r\nDili makawang ang tanan\r\nAng among mga pagdayeg\r\nNga mosulbong sa langit\r\nSa trono mo,  Ikaw mahimaya\r\n\r\nTaliwala sa pagsulay ug paglutos\r\nNaangkon ko ang kadaugan\r\nSa balatian ug sakit, ohh ohh\r\nNaangkon ko ang kaayuhan\r\n',NULL),(21,'10 Reason',61,'Bless the Lord oh my soul\r\nOh my soul\r\nWorship His Holy name\r\nSing like never before\r\nOh my soul\r\nI\'ll worship Your Holy name\r\n\r\nThe sun comes up\r\nIt\'s a new day dawning\r\nIt\'s time to sing Your song again\r\nWhatever may pass\r\nAnd whatever lies before me\r\nLet me be singing\r\nWhen the evening comes\r\n\r\nBless the Lord oh my soul\r\nOh my soul\r\nWorship His Holy name\r\nSing like never before\r\nOh my soul\r\nI\'ll worship Your Holy name\r\n\r\nYou\'re rich in love\r\nAnd You\'re slow to anger\r\nYour name is great\r\nAnd Your heart is kind\r\nFor all Your goodness\r\nI will keep on singing\r\nTen thousand reasons\r\nFor my heart to find\r\n\r\nBless the Lord oh my soul\r\nOh my soul\r\nWorship His Holy name\r\nSing like never before\r\nOh my soul\r\nI\'ll worship Your Holy name\r\nBless You Lord\r\n\r\nAnd on that day\r\nWhen my strength is failing\r\nThe end draws near\r\nAnd my time has come\r\nStill my soul will\r\nSing Your praise unending\r\nTen thousand years\r\nAnd then forevermore\r\nForevermore\r\n\r\nBless the Lord oh my soul\r\nOh my soul\r\nWorship His Holy name\r\nSing like never before\r\nOh my soul\r\nI\'ll worship Your Holy name\r\n\r\nBless the Lord oh my soul\r\nOh my soul\r\nWorship His Holy name\r\nSing like never before\r\nOh my soul\r\nI\'ll worship Your Holy name\r\nYes, I\'ll worship Your Holy name\r\nI\'ll worship Your Holy name\r\n\r\nSing like never before\r\nOh my soul\r\nI\'ll worship Your Holy name\r\nJesus I will worship Your Holy name\r\nWorship Your Holy name\r\n',NULL),(22,'ALAB',62,'VERSE 1\r\nSa gitna man ng panganib\r\nKailan may hindi ako\r\nMangangamba\r\nPagkat kasama Ka\r\nDi maaring manahimik\r\nMga labi ko’y\r\nSabik na sumamba\r\nPapupurihan Ka\r\n\r\nREFRAIN\r\nAanhin ko ang ligayang\r\nDulot ng mundo\r\nKung higit pa sa\r\nSapat ang ‘Yong\r\nInalay do’n sa\r\nKrus ng kalbaryo\r\n\r\nCHORUS\r\nAlab ng pag-ibig Mo’y\r\nDakila at wagas\r\nLiwanag sa tinahak kong landas\r\nBuhay na walang gabay Mo ay\r\nLimot ko na\r\nHindi ko kakayaning mag-isa\r\nKung sa kalaunan ay\r\nHumupa ang lakas\r\nNalalabi kong oras mag wakas\r\n\r\nNgalan Mo’y itataas\r\nSa bawat paghinga\r\nHanggang sa dulo ng\r\nWalang hanggan\r\n\r\nVERSE 2\r\nKalakip ng mga awit\r\nAy ang labis\r\nKong Sayo’y pagkamangha\r\nWag nang matapos pa\r\nDi maaring manatili\r\nPuso ko’t mga paa’y\r\nLumulundag sa labis na tuwa\r\n\r\nREFRAIN 2\r\nSusuyurin ko ang bawat\r\nSulok ng mundo\r\nKung sa bawat\r\nHakbang ay papalapit\r\nDo’n sa pinto ng puso Mo\r\n\r\nBRIDGE\r\nHindi ako pinilit\r\nKusang lumalapit\r\nDo’n sa may aninag\r\nDo’n sa may nagliliyab\r\n',NULL),(23,'Alang kanimo ang himaya',1,'Alang kanimo ang himaya\r\nAlang kanimo ang pagdayeg\r\nGikan kanimo ang kusog\r\nPara kanimo ang dungog\r\n\r\nCHORUS:\r\nOh\' Diyos Ikaw, Ikaw\r\nAng tinubdan ning tanan\r\nSa matag adlaw sa among\r\nMga pagkinahanglan\r\n\r\nKay Ikaw ang dalangpanan\r\nOh\' Diyos Ikaw ang tinubdan\r\nNing tanan\r\n',NULL),(24,'ANAA S\'YA',63,'Verse 1\r\nIgsuon ko tindog\r\nKalimtan ang kagahapon ta\r\nAtubangon ta ang ugma\r\nNga puno sa paglaum\r\n\r\nRef:\r\nAng mga pagsulay mulabay lamang\r\nIsalig ang tanan Kaniya\r\n\r\nChorus:\r\nSi Hesus ang paglaum\r\nkaniya may kasiguruhan\r\nGugma Nya way paglubad\r\nDili ta Nya talikdan\r\nSangpita ang ngalan Nya\r\nAnaa Sya magatubag\r\nDIli ta Nya pasagdan\r\nKanunay ana Sya\r\n\r\nVerse 2\r\nIgsuon ko Tindog\r\nAnia Sya nga manunubos ta\r\nKagul-anan kuhaon Niya\r\nKalipay ang ipasinati Nya\r\n\r\nBridge:\r\nMaayo ang Dios \r\nwala Sya mausab\r\nMatinud-anan Sya \r\nsa tanang panahon\r\n',NULL),(25,'ANG ATONG DIOS MAAYO',1,'Ang atong Dios maayo\r\nIya kitang giatiman\r\nWala ta Niya pasagdi\r\nPanahon sa atong kalisdanan\r\n\r\nMausab man imong higala\r\nMausab man imong hinigugma\r\nMausab man imong ginikanan\r\nAng  atong Dios\r\nWalay pagkausa\r\n\r\nChorus:\r\nBusa singgit, singgit\r\nSinggit ug hallelujah\r\nSayaw, sayaw\r\nSayawi Siya\r\nLukso, lukso\r\nLukso sa kalipay\r\nKay ang atong Dios\r\nWalay pagkausab\r\n\r\nAng atong Dios maayo\r\nIya kitang giatiman\r\nWala ta Niya pasagdi\r\nPanahon sa atong kagul-anan\r\n\r\nMangahanaw man ang kalangitan\r\nMangapatag man ang kabukiran\r\nMausab man tibuok kalibutan\r\nAng atong Dios\r\nWalay pagkausab\r\n',NULL),(26,'Ania Na O Dios',64,'ANIA NA O DIOS\r\nANG KASING KASING KO\r\nMALIPAYON NGA \r\nMODAYEG KANIMO\r\n\r\nANG KALIPAY NGA GIBATI\r\nSA SULOD NING DUGHAN KO\r\nWALAY BUTANG NGA IKATANDI\r\nBISAN PA ANG MGA BAHANDI\r\n\r\nKORO:\r\nKAY ANG KALIPAY NGA GIBATI\r\nSA SULOD NING DUGHAN KO\r\n\r\nMODAYEG KO\r\nMODAYEG KO\r\nSA GINOO\r\n[2x]\r\n\r\nMOSAYAW, \r\nMOLUKSO, \r\nMOKANTA, \r\nMOPAKPAK\r\n',NULL),(27,'Ang Presensya mo',65,'Sa kanunay gitinguha ko ang Dihug mo\r\nSa matag adlaw handumon ko ang Pulong mo\r\nKay buot ako magpahimuot Kanimo\r\nBusa lauman ko ang saad mo (2x)\r\n\r\nChorus:\r\nAng Presensya mo Ang Presensya mo\r\nGikinahanglan ko Gikinahanglan ko\r\nAng Presensya mo Ang Presensya mo\r\nNasinati ko Nasinati ko\r\n\r\n(Repeat Verse & Chorus)',NULL),(28,'Ang pulong Mo',60,'Adunay panahon nga ako maga-uga\r\nSa akong pagsimba kanimo O Dios ko\r\nKung akong hinumduman ang mga nabuhat Mo\r\nDili ko makapugong pagdayeg Kanimo\r\n\r\nChorus 1\r\nAng pulong Mo ang hinungdan nga ako\r\nMagapadayon sa pag-alagad Kanimo\r\nAron akong matuman ang kabubot-on Mong\r\nKinabuhi-on ang pulong Mo\r\n\r\nRepeat 1st stanza and Chorus 1\r\n\r\nChorus 2\r\nAng pulong Mo ang hinungdan nga ako\r\nMagapadayon sa pag-alagad Kanimo\r\nAron akong maangkon ang kinabuhing dayon\r\nNga gisaad Mo sa pulong Mo\r\n\r\nBridge\r\nMoundang ba ako sa pagdayeg ko Kanimo\r\nKung naginhawa ko ang hangin nga gikan Kanimo\r\nMoundang ba ako sa akong pagtuo\r\nKon nasayud kung ako gipakamatyan Mo\r\n\r\nRepeat Chorus 1 & 2\r\nNga gisaad Mo sa pulong Mo (2x)\r\n',NULL),(29,'Angayan Pasalamatan',66,'Chorus:\r\nIhatag ko kining halad ko Diha sa atong Ginoo\r\nPamaagi sa Ikabalos ko Diha sa atong Ginoo\r\n\r\nPara hatagan, Panalanginan, Para dli makabsan\r\nKay ang tanan gikan lamang sa Dios\r\n\r\nVerse:\r\nDalangpanan Kamatuoran\r\nSinugdanan Katapusan\r\nKinabuhi ug Kalipay\r\nKatagbawan Ang Tanan\r\n\r\nChorus:\r\nIhatag ko kining halad ko Diha sa atong Ginoo\r\nPamaagi sa Ikabalos ko Diha sa atong Ginoo\r\n\r\nPara hatagan, Panalanginan, Para dli makabsan\r\nKay ang tanan gikan lamang sa Dios\r\n\r\n(Instrumental)\r\n\r\nPara hatagan, Panalanginan, \r\nPara dli makubsan\r\nKay ang tanan gikan \r\nlamang sa Dios\r\n',NULL),(30,'Ania ako',67,'Intro:\r\nO Dios, ang akong ginoo \r\nKahibulongan ka sa kinabuhi ko\r\nGipili mo ako bisan sa kasal-anan ko \r\nUnsa ba ang ikabalos ko? \r\n\r\nRefrain:\r\nHesus, ang unang gugma ko \r\nGihigugma ka tungod sa paghigugma mo \r\nGikuptan mo ako bisan sa kapakyasan ko \r\nUnsa ba ang ikabalos ko? \r\n\r\nChorus:\r\nHesus ania ako \r\nGinatugyan ang kinabuhi ko \r\nSa tanan nga milagrong gibuhat mo \r\nSalamat o along ginoo \r\n\r\n(Back to Refrain then Chorus)\r\n\r\nBridge:\r\nSa pag-ula mo sa krus sa kaluwasan ko \r\nGiusab mo ako aron mahisama mo \r\nO dios gamita ko sa kahimayaan mo \r\nGinoong dios ania ako \r\n\r\n(Back to Chorus)\r\n\r\nSa tanan nga milagrong gibuhat mo \r\nSalamat o akong ginoo.....\r\n',NULL),(31,'AWIT SA PANAGHIUSA',68,'Pagkaanindot nga lantawon \r\nang Kristohanon \r\nKung maghiusa puno sa gugma\r\nwalay panagsina\r\nPagkatahum nalang gayud\r\nnga Lantawon kung ang tanang \r\nKristohanon magkahiusa na karon\r\n\r\nChorus:\r\nKay sa Dios kitang tanan Usara\r\nWalay relihiyon\r\nWalay dominasyon\r\nKitang tanan managsuon\r\n\r\nKay sa Dios kitang tanan Usara\r\nIhatag ang matam-is mong pahiyum\r\nPagkatahum nalang gayud \r\nKung ang tanang Kristohanon\r\nManagkatigum\r\n',NULL),(32,'bag-ong kinabuhi',98,'Verse:\r\nDaghag Na usab sa atong \r\nMga kinabuhi Tungod sa Iyang \r\nBuhi nga Pulong \r\nMaayo ang Dios (2x)\r\n\r\nref:\r\nNagpagamit \r\nNata karon \r\nSa atong\r\nBuhi nga Dios\r\n\r\nChorus:\r\nSila Mangabi\'g kalag\r\nKami ang mag-aawit Sa buhi nga Dios\r\nMilambo nata Karon\r\nUg nadasig  tungod sa Buhi nga Dios\r\n\r\nVerse:\r\nDaghag Na usab sa atong mga kinabuhi\r\nMga kinabuhi Tungod sa Iyang \r\nBuhi nga Pulong \r\nMaayo ang Dios (2x)\r\n\r\nref:\r\nNagpagamit \r\nNata karon \r\nSa atong\r\nBuhi nga Dios\r\n\r\nChorus:\r\nSila Mangabig kalag\r\nKami ang mag-aawit Sa buhi nga Dios\r\nNilambo nata Karon\r\nUg nadasig  tungod sa Buhi nga Dios\r\n\r\nBrigde:\r\n\r\nDili makawang\r\nDli masayang\r\nmga pagdayeg\r\nug pasalamat (2x)\r\n\r\nChorus:\r\nSila Mangabig kalag\r\nKami ang mag-aawit Sa buhi nga Dios\r\nNilambo nata Karon\r\nUg nadasig  tungod sa Buhi nga Dios (2x)\r\n',NULL),(33,'BALIKAN NING TANAN',69,'ANG KASING-KASING KO GINOO \r\nNAG AWIT TUNGOD SA KAAYO MO\r\nNAGPASALAMAT SA MGA PULONG MO \r\nWALAY IKATANDI UG DILI MATUKIB \r\nNGA IKAW ANG AKONG HARI (2x)\r\n\r\nChorus:\r\nANG DUGHAN KO PUNO SA KALIPAY\r\nTUNGOD SA KAAYO MO\r\nWALA AKO NAGMAHAY\r\nNAGPASALAMAT SA KANUNAY \r\nSA MGA BUHAT MO IKAW LAMANG ANG\r\nBALIKAN NING TANAN\r\n\r\nBridge:\r\nHIMAYA UG DUNGOG\r\nKANIMO IGABALIK\r\nKAY IKAW LAMANG ANG DIOS \r\nNGA LABING TAKUS\r\n',NULL),(34,'Bantugan',70,'Whooah!! Awitan siya\r\n\r\nVerse 1:\r\nSa tanang panahon \r\nAng Dios matinud-anon\r\nSa mtag higayon pabilin\r\nLang kitang malaumon\r\n\r\nNiining kalibotan\r\nBisag puno’g kasakit\r\nApan anaa siya\r\nUban sa grasya niya ug gugma\r\n\r\nChorus:\r\nMao nang Daygon siya\r\nTanang Dapit, Daygon siya\r\nSa Tanang Oras, Daygon siya\r\nSa Kadaghanan, Daygon siya\r\nSa Kamingawan, Awitan siya\r\nSa Kadagatan, Simbahon siya\r\nSa Kapatagan, Yukbuan siya\r\nSa Kabukiran, Si Hesu-Kristo\r\nNga Bantugan\r\n\r\nWhooah!! Awitan siya\r\n\r\nVerse 2:\r\nSa iyang mga mata\r\nKita nalantawan niya\r\nMaayo’g Dautan\r\nTanang binuhatan nakit-an\r\n\r\nMosidlak ug mosalop man\r\nAng kahayag sa Adlaw\r\nApan ang saad niya\r\nSa kahangturan magpabilin\r\n\r\n(Repeat Chorus)\r\nBridge:\r\nMaayo siya nga Dios\r\nMagpabilin siyang Takus\r\nSa mga Pagdayeg\r\nNgalan niya iga Singgit (4x)\r\n\r\n(Repeat Chorus 2x)\r\nWhooah!! Awitan siya\r\nSi Hesu-Kristo Nga Bantugan\r\n(2x)\r\n',NULL),(35,'Bastat ikaw',1,'Verse\r\nSA BUHAY KO IKAW ANG BUKAS \