s 3x)\r\n',NULL),(179,'Sayaw Kita',69,'verse:\r\nTanang adunay kusog\r\nMudayeg kaniya\r\nTanang adunay gininhawa\r\nMusinggit ug hallejah\r\n\r\nKay kita ang katawhan\r\nNga iyang giila\r\nBusa Pasalamatan\r\nUg Pasidunggan Siya\r\n(2x)\r\n\r\nChorus:\r\nSayaw Kita Kamot Ipalakpak\r\nDaygon siya Sayaw kita\r\nTiil ilukso ta Sa ngalan niya\r\nSayaw kita kamot iwarawara\r\nSa presensya niya\r\nSayaw kita, Sayaw kita\r\n\r\n(Repeat Verse & Chorus)\r\n',NULL),(180,'Sinugdanan',69,'Verse\r\nSa sinugdanan Gimugna mo ang kalibutan\r\nGihulma mo tungod sa imong Pagkagamhanan\r\nOh Akong Ginoo\r\nAng pulong mo mga saad nga imong pagatumanon\r\nUg nag iwag sa dalan diin ako padulong\r\nOh Hesus\r\n\r\nChorus:\r\nKay ikaw oh Dios Ang Kagawasan ko\r\nAng kalipay sa Presensya mo\r\nAng kaayo sa Balatian ko\r\nSimbahon ka hangtud sa hangtud\r\n\r\nKay ikaw Hesus ang Gisaligan ko\r\nSa matag karon ug unya\r\nNgalan mo pasidunggan ko\r\nDungog ug Himaya\r\nKanimo lang Magpasalamat\r\nBuhaton ko Ang Tanan\r\nSa paglipay kanimo\r\n\r\nVerse 2\r\nDili ko igsapayan ang sulti sa uban\r\nSulod ning kasing-kasing \r\nKalipay way kinutuban\r\nTanang katawhan ug tibuok kalibutan\r\nMagadayeg sa imong pagkagamhanan\r\nOh akong Hesus\r\n\r\n(Repeat Chorus 2x)\r\n',NULL),(181,'Sa Gugma mo',73,'Verse 1\r\nNaga-awas ang akong kalipay\r\nSa dihang na himugso Ka diri \r\nSa kinabuhi ko\r\n\r\nVerse 2\r\nDili ko gayod kapugngan \r\nIkasugilon ang Imong ngalan\r\nTungod sa gugmang nasinatian\r\n               \r\n\r\nVerse 3\r\nPre-Chorus:\r\nKapugngan lang baha\r\nUg hinaguros sa hangin\r\nSa gugma Mo oh Dios \r\nAko magapabilin \r\n\r\nVerse 4\r\nChorus:\r\nMolukso ko molukso ko\r\nSa gugma Mo\r\nKanako nagabag-o\r\n\r\nVerse 5\r\nMo sayaw ko mo sayaw ko \r\nSa gugma Mo\r\nKanako nagabag-o\r\n\r\nVerse 6\r\nIsyagit ko isyagit ko \r\nAng ngalan Mo\r\nKanako nagabag-o\r\n\r\nVerse 7\r\nIbayaw ko ibayaw ko\r\nAng ngalan Mo\r\nKanako nagabag-oNaga-awas ang akong kalipay\r\nSa dihang na himugso Ka dir